import React from "react";

function Profiles({users}) {
  console.log({users})
  return (
    <div className="profiles">
      <h1>Select a ptofile</h1>
      {users.map(user => {
        <li key={user.userId} {...user}>{user.userId}</li> 
      })}
    </div>
  );
}

export default Profiles;
